import React, { useEffect, useState } from "react";
import "./App.css";

function App() {
  const [loding, setLoading] = useState(true);
  useEffect(() => {
    const isCallApi = fetch("https://api.coinpaprika.com/v1/tickers").then();
    console.log(isCallApi);
  }, []);

  return (
    <div className="App">
      <h1>The Coins!</h1>
      {loding ? <strong>Loading...</strong> : null}
    </div>
  );
}

export default App;
